window.CUCUMBER_MESSAGES = [{"meta":{"protocolVersion":"24.1.0","implementation":{"version":"10.6.0","name":"cucumber-js"},"cpu":{"name":"x64"},"os":{"name":"win32","version":"10.0.22621"},"runtime":{"name":"node.js","version":"18.18.2"}}},{"source":{"data":"Feature: Crear page\r\n\r\n    @run @pages\r\n    Scenario: escenario_1 - Crear una page con un título y un audio\r\n        Given inicio la aplicación\r\n        And inicio sesión si es necesario\r\n        And abro la sección de \"Pages\"\r\n        And doy click en \"New page\"\r\n        And ingreso \"Page de prueba\" como nombre de la página\r\n        And agrego un audio a la página\r\n        When publico la página\r\n        Then la página debe existir en la lista\r\n        And el audio se agregó correctamente\r\n\r\n    @run @pages @v3 @debug\r\n    Scenario: escenario_2 - Crear una page con un título, un párrafo y un video embebido de YouTube\r\n        Given inicio la aplicación\r\n        And inicio sesión si es necesario\r\n        And abro la sección de \"Pages\"\r\n        And doy click en \"New page\"\r\n        And ingreso \"Página de prueba YT\" como nombre de la página\r\n        And ingreso \"contenido de la página con link a youtube\" como contenido de la página\r\n        And agrego un video embebido de YouTube con link \"https://www.youtube.com/watch?v=edVYLVDDgh0\"\r\n        When publico la página\r\n        Then abro la sección de \"Pages\"\r\n        And la página debe existir en la lista\r\n        And el video se agregó correctamente\r\n\r\n    @run @pages @v3 @debug\r\n    Scenario: escenario_3 - Crear una page básica con una URL definida (slug)\r\n        Given inicio la aplicación\r\n        And inicio sesión si es necesario\r\n        And abro la sección de \"Pages\"\r\n        And doy click en \"New page\"\r\n        And ingreso \"Page de prueba con slug\" como nombre de la página\r\n        And abro las configuraciones de la página\r\n        And cambio el slug de la página por \"slug-de-prueba\"\r\n        And cierro las configuraciones de la página\r\n        When publico la página\r\n        Then abro la sección de \"Pages\"\r\n        And la página debe existir en la lista\r\n        And puedo navegar a la URL con el slug asignado\r\n\r\n    @run @pages @v3\r\n    Scenario: escenario_4 - Crear una page básica, previsualizarla y dejarla en borrador\r\n        Given inicio la aplicación\r\n        And inicio sesión si es necesario\r\n        And abro la sección de \"Pages\"\r\n        And doy click en \"New page\"\r\n        And ingreso \"Page de prueba con preview\" como nombre de la página\r\n        And ingreso \"contenido de la página con preview\" como contenido de la página\r\n        When ingreso a la previsualización\r\n        Then puedo previsualizar correctamente la página\r\n        And salgo de la previsualización\r\n        When guardo el borrador de la página\r\n        Then la página debe existir en la lista\r\n        And la página debe tener el estado \"Draft\"","uri":"step_definitions_v3\\features\\crear-page.feature","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"feature":{"tags":[],"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"Crear page","description":"","children":[{"scenario":{"id":"a04174ca-5a3d-426d-9e7e-e06d892ae774","tags":[{"location":{"line":3,"column":5},"name":"@run","id":"41c9921f-ec57-4747-9e90-e40823689a88"},{"location":{"line":3,"column":10},"name":"@pages","id":"867e673f-b084-4a5d-bbcb-c241e1f9c048"}],"location":{"line":4,"column":5},"keyword":"Scenario","name":"escenario_1 - Crear una page con un título y un audio","description":"","steps":[{"id":"11b3e676-a0dd-42cd-9b3f-189a43a549bb","location":{"line":5,"column":9},"keyword":"Given ","keywordType":"Context","text":"inicio la aplicación"},{"id":"ab6fedb0-2790-45e1-90d8-2d7c53fb7948","location":{"line":6,"column":9},"keyword":"And ","keywordType":"Conjunction","text":"inicio sesión si es necesario"  nombre del tag\r\n        And ingreso \"Descripción de tag de prueba\" como descripción del tag\r\n        When guardo el tag\r\n        Then el tag se guarda exitosamente\r\n        And abro la sección de \"Tags\"\r\n        And existen dos tags con nombre \"Tag de prueba duplicado\"\r\n        And los dos tags tienen slug diferente\r\n\r\n    @run @tags\r\n    Scenario: escenario_3 - Crear tag con una imagen\r\n        Given inicio la aplicación\r\n        And inicio sesión si es necesario\r\n        And abro la sección de \"Tags\"\r\n        And doy click en \"New tag\"\r\n        And ingreso \"Tag de prueba con imagen\" como nombre del tag\r\n        And ingreso \"Descripción de tag de prueba\" como descripción del tag\r\n        And agrego una imagen al tag\r\n        When guardo el tag\r\n        Then el tag se guarda exitosamente\r\n        And abro la sección de \"Tags\"\r\n        And el tag se encuentra en la lista\r\n        And abro la página del tag\r\n        And el tag debe tener la imagen\r\n\r\n\r\n    @run @tags @v3\r\n    Scenario: escenario_4 - Crear tag con Meta Data\r\n        Given inicio la aplicación\r\n        And inicio sesión si es necesario\r\n        And abro la sección de \"Tags\"\r\n        And doy click en \"New tag\"\r\n        And ingreso \"Tag de prueba con imagen\" como nombre del tag\r\n        And ingreso \"Descripción de tag de prueba\" como descripción del tag\r\n        And ingreso datos de meta data con título \"Metatitulo\" y descripción \"MetaDesc\"\r\n        When guardo el tag\r\n        Then el tag se guarda exitosamente\r\n        And abro la sección de \"Tags\"\r\n        And el tag se encuentra en la lista\r\n        And abro la página del tag\r\n        And el tag debe contener la información de meta data\r\n","uri":"step_definitions_v3\\features\\crear-tag.feature","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"feature":{"tags":[],"location":{"line":1,"column":1},"language":"en","keyword":"Fea
